func (sc *serverConn) maxHeaderListSize() uint32 {
	n := sc.hs.MaxHeaderBytes
	if n <= 0 {
		n = http.DefaultMaxHeaderBytes
	}
	
	
	const perFieldOverhead = 32 
	const typicalHeaders = 10   
	return uint32(n + typicalHeaders*perFieldOverhead)
}
