	sc.serveG.check()
	
	if st, ok := sc.streams[streamID]; ok {
		return st.state, st
	}
	
	
	
	
	
	
	if streamID%2 == 1 {
		if streamID <= sc.maxClientStreamID {
			return stateClosed, nil
		}
	} else {
		if streamID <= sc.maxPushPromiseID {
			return stateClosed, nil
		}
	}
	return stateIdle, nil
